pragma solidity ^0.6.0;

contract SimpleStorage{
    uint256 public favouriteNumber ;

    struct People{
        uint256 favouriteNumber;
        string name;

    }

    People public person = People({
        favouriteNumber:1,
        name:"sameer"
    });

    function store(uint256 unit) public{
        favouriteNumber = unit;
    }
}
